import Nav from 'react-bootstrap/Nav';
import CallIcon from '@mui/icons-material/Call';
import MailIcon from '@mui/icons-material/Mail';
import  ReadComplaint from '/ReadComplaint'
import React, { useState } from "react";
import Button from '@mui/material/Button';

const textstyle={color:'white',
marginTop:'10px',
marginLeft:'20px',
marginRight:'20px',
fontSize: '25px',
fontFamily: "Times New Roman Times serif"

}

const MyNavbar = () => {
  const[openModal, setOpenModal] = useState(false);
  const closeModal = ()=>setOpenModal(false);

  return (
    <div style={{ backgroundColor: "#8533ff", height: "70px" , color:'white'}}>

    <Nav defaultActiveKey="/home" as="ul">
    <Nav.Item as="li">
        <Nav.Link style={textstyle}>Home</Nav.Link>
      </Nav.Item>
      <Nav.Item as="li">
        <Nav.Link style={textstyle} href = '/placeorder'>Complaint Punch</Nav.Link>
      </Nav.Item>
      <Nav.Item as="li">
        <Nav.Link style={textstyle} >Link</Nav.Link>
      </Nav.Item>
      <Nav.Item as="li">
      <Button variant="outline-primary" onClick={()=>setOpenModal(true)}>open Modal</Button> 
      </Nav.Item>
      
      <span style={{marginLeft:'20%'}}>
      <h5>{<CallIcon/>} 899352666</h5>
      <h5>{<MailIcon/>} crm@gmail.com</h5>
      </span>
    </Nav>
    <div>
   
     {openModal && <ReadComplaint closeModal = {closeModal}/>}
  </div>

    
    </div>
  );
}


export default MyNavbar
